--
-- Auxiliary table for calculating real order level later. 
-- Table structure for table shipping_days
--

DROP TABLE IF EXISTS shipping_days;
CREATE TABLE shipping_days (
  `sales_date` date DEFAULT NULL,
  `shipping_day` varchar(50) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- let's populate the table with dates
DROP PROCEDURE IF EXISTS filldates;
DELIMITER $$
CREATE PROCEDURE filldates(dateStart DATE, dateEnd DATE)
BEGIN
  WHILE dateStart <= dateEnd DO
    SET dateStart = date_add(dateStart, INTERVAL 1 DAY);
  END WHILE;
END;
$$
DELIMITER ;
CALL filldates('2019-07-24',CURDATE());

-- let's construct the real shipping days and update the table
DROP PROCEDURE IF EXISTS real_shipping_date;
DELIMITER $$
CREATE PROCEDURE real_shipping_date()
BEGIN
    UPDATE shipping_days
    SET shipping_day = concat(YEAR(sales_date),'_',WEEKOFYEAR(sales_date),'_1')
    WHERE (DAYOFWEEK(sales_date) > 0 AND DAYOFWEEK(sales_date) < 5);
    
    UPDATE shipping_days
    SET shipping_day = concat(YEAR(sales_date),'_',WEEKOFYEAR(sales_date),'_2')
    WHERE DAYOFWEEK(sales_date) > 4;
END;
$$
DELIMITER ;
CALL real_shipping_date();

